                      <NotionTitle>
                        모두의 정원 
                      </NotionTitle>
                      <NotionLink>
                        모바일 개발자
                      </NotionLink>
                    </NotionBox>
                  </VerySmallBox>

                  <VerySmallBox>
                    <img src={sparkles} />
                    <NotionBox>
                      <NotionTitle>
                        판다 
                      </NotionTitle>
                      <NotionLink>
                        모바일 개발자
                      </NotionLink>
                    </NotionBox>
                  </VerySmallBox>

                </IntroduceBox>

              </RightBox>
            </PopupBox>
          </ModalContent>

        </ModalOverlay>
      )}
    </>
  );
